import React from "react";
import "./header.css";
import like from "./image/like.png";
import shop from "./image/shop.png";
import stat from "./image/statistic.png";
import search from "./image/search.png";
function Header() {
  return (
    <div className="header__preview">
      <h1>DOM1STORE</h1>
      <div className="header__contact">
        <p>Бесплатно по УК</p>
        <p className="txt_bolt">+38 (067) 432-43 </p>
      </div>
      <div className="header__hours">
        <p>2018danil@gmail.com</p>
        <p className="txt_bolt">9:00 - 21:00</p>
      </div>
      <div className="header__search">
        <input placeholder="Поиск по товарам" />
        <button onC>
          <img src={search} alt="sd" />
        </button>
      </div>
      <div className="header__work">
        <button>
          <img src={stat} alt="sd" />
        </button>
        <button>
          <img src={shop} alt="sd" />
        </button>{" "}
        <button>
          <img src={like} alt="sd" />
        </button>
      </div>
    </div>
  );
}

export default Header;
